import './Helper.css';
import { Col, Container, Row } from "react-bootstrap";


function Helper(){
    return(
        <Container>
            <Row>
                <Col lg = "6" md = "6" sm = "12"> 
                <img className = "w-100" src = "https://static.nike.com/a/images/t_PDP_1728_v1/f_auto,q_auto:eco/758c805c-dde5-4df5-9780-56196bcc238a/air-jordan-1-retro-high-og-womens-shoes-LcJVSj.png" />
                </Col>
                
                <Col lg = "6" md = "6" sm = "12">
                    <h1>Air Jordan 1 Retro High OG</h1>
                    <h4 class = "text-muted">Women's Shoes</h4>
                    <p>Код товара: 05443453</p>

                    <div className = "cost">
                        <p>44.99$ <span class = "text-muted"><s>49.99%</s></span></p>
                    </div>
                </Col>
            </Row>
        </Container>
    )
}

export default Helper
